--------------------------------------------------------
--  Creazione tabella W9GARA_ENTINAZ
--------------------------------------------------------
CREATE TABLE SITATSA.W9GARA_ENTINAZ 
   (	CODGARA NUMERIC(10) NOT NULL,
	CODEIN VARCHAR(16), 
	OGGETTO VARCHAR(1024), 
	IDAVGARA VARCHAR(20), 
	IMPORTO_GARA NUMERIC(24,5), 
	NLOTTI NUMERIC(2), 
	TIPO_APP NUMERIC(7), 
	DGURI TIMESTAMP, 
	DSCADE TIMESTAMP, 
	ID_SCELTA_CONTRAENTE NUMERIC(7), 
	ID_MODO_GARA NUMERIC(7), 
	RUP VARCHAR(10),
	TIPO_CONTRATTO VARCHAR(5) 
   ) IN TBS_SITATSA_N0 INDEX IN TBS_SITATSA_N0;
ALTER TABLE SITATSA.W9GARA_ENTINAZ
   ADD CONSTRAINT W9GARA_ENTINAZ_PK PRIMARY KEY ( CODGARA );
GRANT SELECT,INSERT,UPDATE,DELETE ON TABLE SITATSA.W9GARA_ENTINAZ TO SITATSA;

--------------------------------------------------------
--  Creazione tabella W9LOTT_ENTINAZ
--------------------------------------------------------
CREATE TABLE SITATSA.W9LOTT_ENTINAZ 
   (	CODGARA NUMERIC(10) NOT NULL,
	CODLOTT NUMERIC(10) NOT NULL,
	OGGETTO VARCHAR(1024), 
	IMPORTO_TOT NUMERIC(24,5), 
	CPV VARCHAR(12), 
	ID_CATEGORIA_PREVALENTE VARCHAR(5),
	CLASCAT VARCHAR(7), 
	CIG VARCHAR(10),
	IMP_AGG VARCHAR(100), 
	IMPORTO_AGGIUDICAZIONE NUMERIC(24,5),
	DATA_VERB_AGGIUDICAZIONE TIMESTAMP,
	FILE_ALLEGATO BLOB (10 M ) LOGGED NOT COMPACT
   ) IN TBS_SITATSA_N0 INDEX IN TBS_SITATSA_N0;
ALTER TABLE SITATSA.W9LOTT_ENTINAZ
   ADD CONSTRAINT W9LOTT_ENTINAZ_PK PRIMARY KEY ( CODGARA, CODLOTT );
GRANT SELECT,INSERT,UPDATE,DELETE ON TABLE SITATSA.W9LOTT_ENTINAZ TO SITATSA;
   
